import React, { useState, useRef, useEffect } from 'react';
import "./styles.css";
import { Link } from "react-router-dom";

const Viewer = () => {
  const [roomId, setRoomId] = useState('');
  const [comments, setComments] = useState([]);
  const [newComment, setNewComment] = useState('');
  const videoRef = useRef(null);
  const ws = useRef(null);
  const mediaSource = useRef(null);
  const sourceBuffer = useRef(null);
  const queue = useRef([]); // Queue for buffering video chunks if SourceBuffer is updating

  const connectToStream = () => {
    if (!roomId) {
      alert('Enter a room ID!');
      return;
    }

    const status = document.getElementById('status');
    const videoElement = videoRef.current;

    // Initialize WebSocket
    ws.current = new WebSocket('wss://final-5sjc.onrender.com');
    mediaSource.current = new MediaSource();
    videoElement.src = URL.createObjectURL(mediaSource.current);

    ws.current.onopen = () => {
      status.textContent = 'Connected to server as viewer';
      ws.current.send(JSON.stringify({ type: 'viewer', roomId }));
    };

    ws.current.onmessage = (event) => {
      handleWebSocketMessage(event);
    };

    ws.current.onerror = () => {
      status.textContent = 'WebSocket error occurred';
    };

    ws.current.onclose = () => {
      status.textContent = 'Disconnected from server';
    };

    mediaSource.current.addEventListener('sourceopen', () => {
      if (!sourceBuffer.current) {
        sourceBuffer.current = mediaSource.current.addSourceBuffer('video/webm; codecs="vp8, opus"');

        sourceBuffer.current.addEventListener('updateend', () => {
          // Append next chunk if SourceBuffer is ready
          if (queue.current.length > 0 && !sourceBuffer.current.updating) {
            try {
              sourceBuffer.current.appendBuffer(queue.current.shift());
            } catch (error) {
              console.error('Error appending buffer:', error);
              status.textContent = 'Error in buffering stream';
            }
          }
        });

        sourceBuffer.current.addEventListener('error', (e) => {
          console.error('SourceBuffer Error:', e);
          status.textContent = 'Error in buffering stream';
        });
      }
    });
  };

  const handleWebSocketMessage = (event) => {
    const status = document.getElementById('status');

    if (typeof event.data === 'string') {
      // Handle control messages and comments
      const message = JSON.parse(event.data);

      if (message.type === 'no-stream') {
        status.textContent = 'No active stream';
      } else if (message.type === 'end-stream') {
        status.textContent = 'Stream ended';
        if (mediaSource.current.readyState === 'open') {
          mediaSource.current.endOfStream();
        }
      } else if (message.type === 'comment') {
        // Display comments
        setComments((prev) => [
          ...prev,
          { viewerId: message.viewerId, message: message.message },
        ]);
      }
    } else if (event.data instanceof Blob || event.data instanceof ArrayBuffer) {
      // Handle video/audio chunks
      const reader = new FileReader();
      reader.onload = () => {
        const arrayBuffer = reader.result;
        if (sourceBuffer.current && !sourceBuffer.current.updating) {
          try {
            sourceBuffer.current.appendBuffer(new Uint8Array(arrayBuffer));
          } catch (error) {
            console.error('Error appending buffer:', error);
            status.textContent = 'Error in buffering stream';
          }
        } else {
          queue.current.push(new Uint8Array(arrayBuffer));
        }
      };
      reader.readAsArrayBuffer(event.data);
    }
  };

  const handleSendComment = () => {
    if (newComment.trim()) {
      const commentData = {
        type: 'comment',
        roomId,
        viewerId: 'viewer_' + Math.random().toString(36).substr(2, 9),
        message: newComment,
      };
      ws.current.send(JSON.stringify(commentData));
      setNewComment('');
    }
  };

  useEffect(() => {
    return () => {
      // Cleanup on unmount
      if (ws.current) {
        ws.current.close();
      }
      if (mediaSource.current) {
        mediaSource.current = null;
      }
      if (sourceBuffer.current) {
        sourceBuffer.current = null;
      }
      queue.current = [];
    };
  }, []);

  return (
    <div>
      <header>
        <nav className="navbar">
          <div className="logo">
            STREAM<span>VIBE</span>
          </div>
          <div className="nav-links">
            <Link to="/">Home</Link>
            <Link to="/about">About</Link>
            <Link to="/">Streams</Link>
            <Link to="/contact">Contact</Link>
          </div>
        </nav>
      </header>

      <section className='hero'>
        <input
          type="text"
          placeholder="Enter Room ID"
          value={roomId}
          onChange={(e) => setRoomId(e.target.value)}
        />
        <button onClick={connectToStream}>Connect to Stream</button>
        <video id="video" ref={videoRef} autoPlay playsInline controls style={{ width: '100%' }} />
        <p id="status"></p>
      </section>

      <section className="comments-section">
        <h3>Comments</h3>
        <div className="comments-list">
          {comments.map((comment, index) => (
            <div key={index} className="comment">
              <strong>{comment.viewerId}</strong>: {comment.message}
            </div>
          ))}
        </div>
        <input
          type="text"
          placeholder="Type a comment"
          value={newComment}
          onChange={(e) => setNewComment(e.target.value)}
        />
        <button onClick={handleSendComment}>Send</button>
      </section>

      <footer>
        <div className="footer-content">
          <div className="footer-section">
            <h3>Quick Links</h3>
            <Link to="/">Home</Link>
            <Link to="/about">About Us</Link>
            <Link to="/rules">Rules</Link>
            <Link to="/legacy">Legacy</Link>
            <Link to="/pricing">Pricing</Link>
            <Link to="/contact">Contact</Link>
          </div>
          <div className="footer-section">
            <h3>Legal</h3>
            <a href="#">Terms of Service</a>
            <a href="#">Privacy Policy</a>
          </div>
          <div className="footer-section">
            <h3>Connect</h3>
            <div className="social-links">
              <a href="#">
                <i className="fab fa-facebook"></i>
              </a>
              <a href="#">
                <i className="fab fa-twitter"></i>
              </a>
              <a href="#">
                <i className="fab fa-instagram"></i>
              </a>
            </div>
          </div>
        </div>
        <div className="footer-bottom">
          <p>&copy; 2024 STREAMVIBE. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
};

export default Viewer;
